import React from "react";
import DoctorMenu from "../components/layout/DoctorMenu";
import "../styles/doctorplans.css";
const DoctorPlansPackages = () => {
  const plansData = [
    {
      icon: "novide",
      title: "Novice",
      price: "$10/mth",
      billing: "Billed annually.",
      features: [
        "Access to all basic features",
        "Basic reporting and analytics",
        "Up to 10 individual users",
        "20GB individual data each user",
        "Basic chat and email support",
      ],
      buttonText: "Select Plan",
    },
    {
      icon: "novide",
      title: "charu",
      price: "$10/mth",
      billing: "Billed annually.",
      features: [
        "Access to all basic features",
        "Basic reporting and analytics",
        "Up to 10 individual users",
        "20GB individual data each user",
        "Basic chat and email support",
      ],
      buttonText: "Select Plan",
    },
  ];
  return (
    <DoctorMenu>
      <DoctorMenu>
        <section className="text-center w-100 vh-100 ">
          <h2 className=" pt-5">
            <span> Powerful features for</span>
            <br /> <span className="color-purple">powerful Athletes</span>
          </h2>
          <p className="mt-3">Choose a plan thatâ€™s right for you</p>

          <div
            className="d-flex justify-content-between plan-container "
            style={{ width: "100%", margin: "40px 10px", gap: "20px" }}
          >
            {plansData.map((plan, index) => (
              <PlanSingle key={index} planData={plan} />
            ))}
          </div>
        </section>
      </DoctorMenu>
    </DoctorMenu>
  );
};

export default DoctorPlansPackages;
